    "contracts/ERC1155Claimable.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "./IClaimable.sol";

abstract contract ERC1155Claimable is Context, ERC1155, IClaimable {
    using Address for address;

    // Mapping from address to claimed tokens
    mapping(address => mapping(uint256 => bool)) public _claimants;

    /**
     * @dev See {IClaimable-claim}
     */
    function claim(
        address claimant,
        address faucet,
        uint256 collectibleID
    ) public override {
        require(
            !_claimants[claimant][collectibleID],
            "Address has already claimed collectible"
        );

        // Transfer collectible and mark as claimed
        _safeTransferFrom(faucet, claimant, collectibleID, 1, "0x");
        _claimants[claimant][collectibleID] = true;

        emit Claim(claimant, collectibleID);
    }

    /**
     * @dev See {IClaimable-availableToClaim}
     */
    function availableToClaim(
        address claimant,
        uint256 collectibleID
    ) public view override returns (bool) {
        return !_claimants[claimant][collectibleID];
    }
}
"
    },
    "contracts/IClaimable.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

interface IClaimable {
    /**
     * @dev Emitted when a token type `id` are claimed by `claimant`
     */
    event Claim(address claimant, uint256 collectibleID);

    /**
     * @dev Claims an NFT on behalf of a user
     *
     * @param claimant The claimant address
     * @param faucet The faucet we use to send collectible id `collectibleID` to `claimant`
     * @param collectibleID The collectible ID `claimant` has claimed
     *
     * Requirements:
     *
     * - `claimant` can not have already claimed `collectibleID`
     */
    function claim(
        address claimant,
        address faucet,
        uint256 collectibleID
    ) external;

    /**
     * @dev Determines whether or not `claimant` can claim a token type `id`
     *
     * @param claimant The claimant address
     * @param collectibleID The collectible ID `claimant` want to claim
     *
     * @return claimStatus Whether or not `claimant` is able to claim `id`
     */
    function availableToClaim(address claimant, uint256 collectibleID)
        external
        view
        returns (bool);
}
"
